public class CacheHitRate {
    public static void main(String[] args) {
        SparkConf conf = new SparkConf().setAppName("CacheHitRate");
        JavaSparkContext sc = new JavaSparkContext(conf);

        // Load onsite attributed data
        JavaRDD<String[]> onsiteData = sc.textFile("onsite_data.txt")
                .map(line -> line.split(","))
                .map(arr -> new String[]{arr[0], arr[1]});

        // Load top frequent queries
        JavaRDD<String> topFrequentQueries = sc.textFile("top_frequent_queries.txt")
                .map(line -> line.split(",")[0]);

        // Join onsite data with top frequent queries
        JavaPairRDD<String, String[]> onsiteDataWithQuery = onsiteData.mapToPair(new PairFunction<String[], String, String[]>() {
            @Override
            public Tuple2<String, String[]> call(String[] s) throws Exception {
                return new Tuple2<>(s[0], s);
            }
        }).join(topFrequentQueries.map(new Function<String, Tuple2<String, String>>() {
            @Override
            public Tuple2<String, String> call(String s) throws Exception {
                return new Tuple2<>(s, s);
            }
        }));

        // Calculate hit rate
        JavaPairRDD<String, Double> hitRate = onsiteDataWithQuery.mapToPair(new PairFunction<Tuple2<String, String[]>, String, Double>() {
            @Override
            public Tuple2<String, Double> call(Tuple2<String, String[]> s) throws Exception {
                String query = s._1;
                String[] data = s._2;
                long count = 0;
                for (String[] d : data) {
                    if (d[0].equals(query)) {
                        count++;
                    }
                }
                double hitRate = (double) count / data.length;
                return new Tuple2<>(query, hitRate);
            }
        });

        // Save hit rate
        hitRate.saveAsTextFile("hit_rate.txt");

        sc.stop();
    }
}
