import Foundation

// Abstract Syntax Tree (AST) for Metal Shading Language

// Node types
enum NodeType {
    case expression
    case statement
    case declaration
    case function
    case type
}

// Abstract Syntax Tree node
struct ASTNode {
    let type: NodeType
    var children: [ASTNode] = []
    var value: String?
}

// Expression node
struct ExpressionNode: ASTNode {
    let type: NodeType = .expression
    var value: String?
    var children: [ASTNode] = []
}

// Statement node
struct StatementNode: ASTNode {
    let type: NodeType = .statement
    var children: [ASTNode] = []
}

// Declaration node
struct DeclarationNode: ASTNode {
    let type: NodeType = .declaration
    var name: String
    var type: String?
    var initializer: ExpressionNode?
}

// Function node
struct FunctionNode: ASTNode {
    let type: NodeType = .function
    var name: String
    var returnType: String?
    var parameters: [DeclarationNode] = []
    var body: [StatementNode] = []
}

// Type node
struct TypeNode: ASTNode {
    let type: NodeType = .type
    var name: String
    var attributes: [String] = []
}

